C/指针.html.body:
指针复习

指针实际上就是地址，例如我们平常所说的某个函数返回一个指针，其实返回的是一个地址，而指针变量则是存储地址的变量。
地址输出   %p 实例代码如下：

int main()
{
    int a;
    printf("%p",&a);//出现野指针，实际开发变量声明后必须赋值。
    return 0;
}


指针变量 格式 数据类型 *变量名

int *a=NULL;


指针变量赋值非地址而是普通值

此处需要格外注意
int main()
{
    int a=1;
    int *b=a;
    printf("%d,%p,%d,%p",a,&a,b,&b);
    a=2;
    printf("%d,%p,%d,%p",a,&a,b,&b);
    return 0;
}

上述代码两次输出的结果不一致。变量a的值发生变化后，指针变量b存储的依然是a的值（1）并不是更改后变量a的值（2）。原因指针变量b也有自己的存储空间，如果修改a的值不会更改b的值。
重点区分数组指针和指针数组

数组指针
也称作行指针
格式 int(*p)[n];
()优先级高，首先说明p是一个指针，指向一个整型的一维数组，这个一维数组的长度是n，也可以说是p的步长。也就是说执行p+1时，p要跨过n个整型数据的长度。


指针数组
和普通数组一样，只不过它存放的元素是一个个的指针变量而已。
格式  int *p[n] 
获取数组元素p[0],p[1],p[2]...p[n-1]

TDD/NUnit.html.body:
NUnit

[TestFixture]表示：类包含了测试代码（这个特性可以被继承）。这个类必须是公有的，这个类还必须有一个默认构造函数

[Test]表示它是一个测试方法。测试方法的返回值必须为void并且不能带有参数

[SetUp]属性：用来标识方法，在开始所有测试之前执行，用来在测试前初始化一些资源，比如初始化类

[TearDown]属性：用来标识方法，在所有测试完成之后执行，用来释放一些资源

TestFixtureSetUp/TestFixtureTearDown和SetUp和TearDown相似
不同之处：对于昂贵资源，例如数据库连接，一般都是关键资源。而且多次连接/关闭数据库会造成时间的浪费
SetUp和TearDown是每个test方法执行时，都需要执行，而TestFixtureSetUp/TestFixtureTearDown是该类第一个test执行时，执行TestFixtureSetUp，最后一个执行完后，执行TestFixtureTearDown



[Ignore]属性：用来标识方法，指示这个方法由于某些原因暂时不需要测试（比如没有完成相关代码）


常用方法

测试二个参数是否相等
Assert.AreEqual(　int　expected,　int　actual　);
Assert.AreEqual(　decimal　expected,　decimal　actual　);


测试二个参数是否引用同一个对象
Assert.AreSame(　object　expected,　object　actual　);
Assert.AreNotSame(　object　expected,　object　actual　);


测试一个对象是否被一个数组或列表所包含
Assert.Contains(　object　anObject,　IList　collection　);


测试一个对象是否大于另一个对象
Assert.Greater(　int　arg1,　int　arg2　);

测试一个对象是否小于另一个对象
Assert.Less(　int　arg1,　int　arg2　);

类型断言
Assert.IsInstanceOfType(　Type　expected,　object　actual　);

条件测试
Assert.IsTrue(　bool　condition　);
Assert.IsFalse(　bool　condition);
Assert.IsNull(　object　anObject　);
Assert.IsNotNull(　object　anObject　);
Assert.IsNaN(　double　aDouble　);
Assert.IsEmpty(　string　aString　);
Assert.IsNotEmpty(　string　aString　);
Assert.IsEmpty(　ICollection　collection　);
Assert.IsNotEmpty(　ICollection　collection　);

字符串断言(StringAssert)：提供了许多检验字符串值的有用的方法
StringAssert.Contains(　string　expected,　string　actual　);
StringAssert.StartsWith(　string　expected,　string　actual　);
StringAssert.EndsWith(　string　expected,　string　actual　);
StringAssert.AreEqualIgnoringCase(　string　expected,　string　actual　);



